import { SHOW_HEX, SHOW_RGB, TOGGLE_HISTORY } from './colorTypes'

export const showHex = () => {
  return {
    type: SHOW_HEX
  }
}

export const showRGB = () => {
  return {
    type: SHOW_RGB
  }
}

export const toggleHistory = () => {
  return {
    type: TOGGLE_HISTORY
  }
}
